CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertMasterMerchantFromTblMerchant`()
BEGIN
    DECLARE done INT DEFAULT FALSE;
    
    -- Declaring variables to hold the selected data
	DECLARE v_Merchantid INT;
    DECLARE v_FullName VARCHAR(255);
    DECLARE v_BusinessName VARCHAR(255);
    DECLARE v_BusinessBranch VARCHAR(255);
    DECLARE v_Address VARCHAR(255);
    DECLARE v_GeoCode LONGTEXT;
    DECLARE v_Latitude LONGTEXT;
    DECLARE v_Longitude LONGTEXT;
    DECLARE v_Mobile VARCHAR(255);
    DECLARE v_Email VARCHAR(255);
    DECLARE v_CreateDate DATETIME;
    DECLARE v_MerchantCode VARCHAR(10);


    -- Cursor to loop through tblmerchant records
    DECLARE cur CURSOR FOR 
        SELECT 
            fldMerchantID,
            fldMerchantFullName,
            fldMerchantBusinessName,
            fldMerchantBusinessBranch,
            fldMerchantAddress,
            fldMerchantGMapsPlaceID,
            fldMerchantLat,
            fldMerchantLong,
            fldMerchantMobile,
            fldMerchantEmail,
            fldMerchantDateCreated
        FROM tblmerchant;

    -- Handling loop termination
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;

    read_loop: LOOP
        FETCH cur INTO 
            v_Merchantid,
            v_FullName,
            v_BusinessName,
            v_BusinessBranch,
            v_Address,
            v_GeoCode,
            v_Latitude,
            v_Longitude,
            v_Mobile,
            v_Email,
            v_CreateDate;
        
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Assign default values if NULL
        SET v_FullName = IFNULL(v_FullName, 'Unknown Merchant');
        SET v_BusinessName = IFNULL(v_BusinessName, 'Unnamed Business');
        SET v_BusinessBranch = IFNULL(v_BusinessBranch, 'Main Branch');
        SET v_Address = IFNULL(v_Address, 'No Address Provided');
        SET v_GeoCode = IFNULL(v_GeoCode, 'N/A');
        SET v_Latitude = IFNULL(v_Latitude, '0.0000');
        SET v_Longitude = IFNULL(v_Longitude, '0.0000');
        SET v_Mobile = IFNULL(v_Mobile, '0000000000');
        SET v_Email = IFNULL(v_Email, 'noemail@example.com');
        SET v_CreateDate = IFNULL(v_CreateDate, NOW()); -- Default to current timestamp
        
        
        SET v_MerchantCode = SUBSTRING(REPLACE(UUID(), '-', ''), 1, 10);

        -- Insert into master_merchant
        INSERT INTO master_merchant (
            mm_merchant_id,
            mm_merchant_code,
            mm_merchant_type,
            mm_merchant_fullname,
            mm_business_name,
            mm_business_branch,
            mm_merchant_address,
            mm_merchant_geo_code,
            mm_latitude,
            mm_longitude,
            mm_mobile,
            mm_email,
