CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertMenuCategoriesFromTblCategory`()
BEGIN
    DECLARE done INT DEFAULT FALSE;
    
    -- Declaring variables to hold selected data
    DECLARE v_CategoryMerchantID INT;
    DECLARE v_CategoryName VARCHAR(100);
    DECLARE v_CategoryDesc TEXT;
    DECLARE v_CreatedAt TIMESTAMP;
    DECLARE v_ValidMerchantID INT;

    -- Cursor to loop through tblcategory records
    DECLARE cur CURSOR FOR 
        SELECT 
            fldCategoryMerchantID,
            fldCategoryName,
            fldCategoryDesc
        FROM tblcategory;

    -- Handling loop termination
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;

    read_loop: LOOP
        FETCH cur INTO 
            v_CategoryMerchantID,
            v_CategoryName,
            v_CategoryDesc;

        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Validate Merchant ID (Check if it exists in master_merchant)
        SELECT mm_merchant_id INTO v_ValidMerchantID 
        FROM master_merchant 
        WHERE mm_merchant_id = v_CategoryMerchantID 
        LIMIT 1;

        -- If no valid merchant is found, set a default valid merchant ID (Adjust as needed)
        IF v_ValidMerchantID IS NULL THEN
            SET v_ValidMerchantID = (SELECT mm_merchant_id FROM master_merchant ORDER BY mm_merchant_id LIMIT 1);
        END IF;

        -- Assign default values if NULL
        SET v_CategoryName = IFNULL(v_CategoryName, 'Unnamed Category');
        SET v_CategoryDesc = IFNULL(v_CategoryDesc, 'No Description Available');
        SET v_CreatedAt = NOW(); -- Default to current timestamp

        -- Insert into menu_category
        INSERT INTO menu_category (
            mc_category_merchant_id,
            mc_category_name,
            mc_category_description,
            mc_created_at
        ) VALUES (
            v_ValidMerchantID,  -- Use the verified merchant ID
            v_CategoryName,
            v_CategoryDesc,
            v_CreatedAt
        );

    END LOOP;

    CLOSE cur;
END ;;
DELIMITER ;
