CREATE DEFINER=`root`@`localhost` PROCEDURE `InsertMenuItemsFromInventory`()
BEGIN
    DECLARE v_ItemName VARCHAR(255);
    DECLARE v_ItemImage LONGTEXT;
    DECLARE v_Size INT;
    DECLARE v_CategoryID INT;
    DECLARE v_MerchantID INT;
    DECLARE v_Description TEXT;
    DECLARE v_ItemPrice LONGTEXT;
    DECLARE v_CreatedAt TIMESTAMP;
    
    -- Cursor to iterate through tblinventory
    DECLARE done INT DEFAULT 0;
    DECLARE cur CURSOR FOR 
        SELECT 
            COALESCE(fldInventoryItemName, 'Unknown Item'),
            COALESCE(NULL, ''), 
            COALESCE(NULL, 2), 
            COALESCE(fldInventoryCategoryID, 0), 
            COALESCE(fldInventoryMerchantID, 0), 
            COALESCE(fldInventoryDesc, 'No description'), 
            COALESCE(fldInventoryUnitPrice, '0.00'),
            NOW()
        FROM lagona_express.tblinventory;
    
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    OPEN cur;
    
    read_loop: LOOP
        FETCH cur INTO v_ItemName, v_ItemImage, v_Size, v_CategoryID, v_MerchantID, v_Description, v_ItemPrice, v_CreatedAt;
        
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Insert into menu_item table
        INSERT INTO menu_item (
            mi_item_name, 
            mi_item_image, 
            mi_size, 
            mi_category_id, 
            mi_merchant_id, 
            mi_description, 
            mi_item_price, 
            mi_is_available, 
            mi_created_at
        ) VALUES (
            v_ItemName, 
            v_ItemImage, 
            v_Size, 
            v_CategoryID, 
            v_MerchantID, 
            v_Description, 
            v_ItemPrice, 
            'Available', 
            v_CreatedAt
        );

    END LOOP;

    CLOSE cur;
END ;;
